package com.opdoghoho.mypage;

public class dogLikeList {
	private String age;
	private String no;
	private String kind;
	private String color;
	private String sex;
	private String neuter;
	private String mark;
	private String center;
	private String org;
	
	public dogLikeList() {
		// TODO Auto-generated constructor stub
	}

	public dogLikeList(String age, String no, String kind, String color, String sex, String neuter, String mark,
			String center, String org) {
		super();
		this.age = age;
		this.no = no;
		this.kind = kind;
		this.color = color;
		this.sex = sex;
		this.neuter = neuter;
		this.mark = mark;
		this.center = center;
		this.org = org;
	}

	public String getAge() {
		return age;
	}

	public void setAge(String age) {
		this.age = age;
	}

	public String getNo() {
		return no;
	}

	public void setNo(String no) {
		this.no = no;
	}

	public String getKind() {
		return kind;
	}

	public void setKind(String kind) {
		this.kind = kind;
	}

	public String getColor() {
		return color;
	}

	public void setColor(String color) {
		this.color = color;
	}

	public String getSex() {
		return sex;
	}

	public void setSex(String sex) {
		this.sex = sex;
	}

	public String getNeuter() {
		return neuter;
	}

	public void setNeuter(String neuter) {
		this.neuter = neuter;
	}

	public String getMark() {
		return mark;
	}

	public void setMark(String mark) {
		this.mark = mark;
	}

	public String getCenter() {
		return center;
	}

	public void setCenter(String center) {
		this.center = center;
	}

	public String getOrg() {
		return org;
	}

	public void setOrg(String org) {
		this.org = org;
	}
	
	
	
}
